double KFMSquareRootUtilities::SqrtInteger(int arg)
{
    if (arg < KFM_SQRT_LUT_SIZE && arg >= 0) {
        return fIntegerSqrtLUT[arg];
    }
    else {
        return std::sqrt(arg);
    }
}

double KFMSquareRootUtilities::InverseSqrtInteger(int arg)
{
    if (arg < KFM_SQRT_LUT_SIZE && arg >= 1) {
        return fInverseIntegerSqrtLUT[arg];
    }
    else {
        return 1.0 / std::sqrt(arg);
    }
}

double KFMSquareRootUtilities::SqrtIntegerRatio(int numer, int denom)
{
    return SqrtInteger(numer) * InverseSqrtInteger(denom);
}


